import Link from 'next/link';

const Navbar = () =>(
    <div>
<ul>
            <li>
            <Link href="/"><a>Home</a></Link>
            </li>
            <li>
            <Link href="/aboutSpaceX"><a>About SpaceX Programs</a></Link>
            </li>
        </ul>
        <style jsx>{`
           ul{
               background: #333;
               color:#fff;
           } 
        `}</style>
        </div>
);

export default Navbar;
